// Render Movie Cards
function renderMovieCards() {
    const moviesGrid = document.getElementById('movies-grid');
    if (!moviesGrid) return;

    // Clear the grid
    moviesGrid.innerHTML = '';

    // Check if there are filtered movies
    if (appState.filteredMovies.length === 0) {
        moviesGrid.innerHTML = `
                    <div class="no-results" style="grid-column: 1 / -1;">
                        <i class="fas fa-film no-results-icon"></i>
                        <h3>No movies found</h3>
                        <p>Try adjusting your search terms</p>
                    </div>
                `;
        return;
    }

    // Render each movie card
    appState.filteredMovies.forEach(movie => {
        const movieCard = document.createElement('div');
        movieCard.className = 'card';
        movieCard.dataset.id = movie.id;
        movieCard.dataset.type = 'movie';

        movieCard.innerHTML = `
                    <img src="${movie.poster}" alt="${movie.title}" class="card-img" loading="lazy">
                    <div class="card-content">
                        <h3 class="card-title">${movie.title}</h3>
                        <p class="card-subtitle">${movie.year}   ${movie.rating}</p>
                    </div>
                `;

        moviesGrid.appendChild(movieCard);
    });
}

// Render Anime Cards
function renderAnimeCards() {
    const animeGrid = document.getElementById('anime-grid');
    if (!animeGrid) return;

    // Clear the grid
    animeGrid.innerHTML = '';

    // Check if there are filtered anime
    if (appState.filteredAnime.length === 0) {
        animeGrid.innerHTML = `
                    <div class="no-results" style="grid-column: 1 / -1;">
                        <i class="fas fa-tv no-results-icon"></i>
                        <h3>No anime found</h3>
                        <p>Try adjusting your search terms</p>
                    </div>
                `;
        return;
    }

    // Render each anime card
    appState.filteredAnime.forEach(anime => {
        const animeCard = document.createElement('div');
        animeCard.className = 'card';
        animeCard.dataset.id = anime.id;
        animeCard.dataset.type = 'anime';

        animeCard.innerHTML = `
                    <img src="${anime.poster}" alt="${anime.title}" class="card-img" loading="lazy">
                    <div class="card-content">
                        <h3 class="card-title">${anime.title}</h3>
                        <p class="card-subtitle">${anime.year}  ${anime.seasons} Season${anime.seasons > 1 ? 's' : ''}</p>
                    </div>
                `;

        animeGrid.appendChild(animeCard);
    });
}

// Render Movie Detail Page
function renderMovieDetail(movieId) {
    const movie = data.movies.find(m => m.id === parseInt(movieId));
    if (!movie) {
        showError('Movie not found');
        return;
    }

    // Scroll to top smoothly
    window.scrollTo({ top: 0, behavior: 'smooth' });

    const mainContent = document.getElementById('main-content');

    const movieDetailHTML = `
                <div class="container">
                    <div class="breadcrumb">
                        <a href="#" id="back-to-home" role="button" tabindex="0" aria-label="Go back to home page"> Back to Home</a>
                        <span class="breadcrumb-separator">/</span>
                        <span>${movie.title}</span>
                    </div>
                    
                    <div class="movie-detail">
                        <div class="movie-header">
                            <div class="movie-poster">
                                <img src="${movie.poster}" alt="${movie.title}" loading="lazy">
                            </div>
                            <div class="movie-info">
                                <h1 class="movie-title">${movie.title}</h1>
                                <div class="movie-meta">
                                    <span class="movie-rating"> ${movie.rating}/10</span>
                                    <span>${movie.year}</span>
                                </div>
                                <p class="movie-description">${movie.description}</p>
                                
                                <h3 class="mb-20">Available On:</h3>
                                <div class="streaming-platforms">
                                    ${movie.streamingLinks.map(link =>
        `<a href="${link.url}" class="btn btn-primary">Watch Now ${link.platform}</a>`
    ).join('')}
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            `;

    mainContent.innerHTML = movieDetailHTML;

    // Add event listener to back button with keyboard support
    const backButton = document.getElementById('back-to-home');
    if (backButton) {
        backButton.addEventListener('click', (e) => {
            e.preventDefault();
            navigateToHome();
        });

        // Support Enter and Space keys for keyboard navigation
        backButton.addEventListener('keydown', (e) => {
            if (e.key === 'Enter' || e.key === ' ') {
                e.preventDefault();
                navigateToHome();
            }
        });
    }
}

